import React from 'react';
import './css/UI.css';
import List from './List.jsx';

class Content extends React.Component{
    render(){
      const activities=[
        [ 'activty','drink cofee' ],
        ['Mid-day','Take a walk']

      ];

      return (
        <div>
        <List title={activities[activty]} desc={activities[1]}/>
        </div>
      )
    }
}
export default Content;
